import React from "react";
import MvEmail from "../generalLayout/mvEmail";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import MotorSlideImg from "../generalLayout/motorSlideImg";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
const namePage = "Brutale 1000 RR";
const listImgs = [
  {
    contentTitle: "Dedicated control unit",
    img: "brutale1000rr/electronics.jpg",
    content:
      "The Brutale 1000 RR features a full ride-by-wire multi map system with IMU inertial platform, which manages traction control with slip strategies (8 different settings and the option to deactivate it). The Brutale 1000 RR is equipped with a second generation TFT dashboard.",
  },
  {
    contentTitle: "Semi-dry sump",
    img: "brutale1000rr/technology.jpg",
    content:
      "The new splitter lubrication system, deriving from Mv Agusta’s racetrack experience, allows oil to be separated from moving mechanical parts. The semi-dry sump lubrication is capable of guaranteeing mechanical protection under extreme riding conditions such as sharp leans and wheelies.",
  },
  {
    contentTitle: "SAFETY",
    img: "brutale1000rr/safety-m.jpg",
    content:
      "The Öhlins EC electronic regulation package for the fork, the steering damper and the shock absorber fixed to the single-sided swing arm provides optimum driving control in all road conditions.",
  },
];
const imgSlideSrc = [
  "img/brutale1000rr/1.jpg",
  "img/brutale1000rr/2.jpg",
  "img/brutale1000rr/3.jpg",
  "img/brutale1000rr/4.jpg",
  "img/brutale1000rr/5.jpg",
  "img/brutale1000rr/6.jpg",
  "img/brutale1000rr/7.jpg",
];
const manifesto_Arr = ["THE", "ALL-OUT", "HYPER", "NAKED"];
const contentHeaderContent =
  "F1-derived technology for out-of-this-world performance, and the first fully connected bike you can control through the MVRide app.";
const heroGradientStart = "#A4191B";
const heroGradientEnd = "#6B0B0D";
const colorBg = `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`;
const nameHeaderTitle = "brutale1000rr/brutale-1000-rr.svg";
const price = "35.000";
export default function BodyBrutale1000RR() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: colorBg,
        }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <MotorPageHeader
        manifesto_Arr={manifesto_Arr}
        nameHeaderTitle={nameHeaderTitle}
        titleSize="auto 21%"
        colorBg={colorBg}
        contentHeaderContent={contentHeaderContent}
        price={price}
        bgHeaderParallax="brutale1000rr/brutale-1000-rr-xl.webp"
        reveredContent={false}
      />
      <PageName namePage={namePage} />
      <Motor3d
        imgLocate="brutale1000rr/1000rr"
        nameModel="MV AGUSTA BRUTALE 1000 RR"
        price="31.500"
      />
      {/* <br />
      <Motor3dBodyTech listImgs={listImgs} /> */}
      <br />
      <br />
      <MotorSlideImg imgSlideSrc={imgSlideSrc} />
      <br></br>
      <br></br>
      <MvEmail></MvEmail>
      <br />
      <FooterGe />
    </>
  );
}
